// import React from "react";
// import Grid from "./Grid";
import React from "react";
import './style.css';
import nutri from "./nutri.png";
import uniqlo from "./uniqlo.png";
import UniqloPage from "./UniqloPage";
import {
  HashRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function Home() {
  return (
      <div className="App-header">
        <h1 className="name">Joya Jeong</h1>
        <div className="intro">
          I'm a UNSW Information Systems/Commerce student that is an aspiring product
          and UI designer. Check out some of my work below!
        </div>
        <Router>
          <div>
            <Link to='/uniqlo'>
              <img className="resize" src={uniqlo} alt="uniqlo" />
            </Link>

            <Switch>
              <Route path="/uniqlo">
                <UniqloPage />
              </Route>
            </Switch>
          </div>
        </Router>
      </div>
  );
}

export default Home;
